    dateFromWeekNumber(year, week) {
        let d = new Date(year, 0, 1);
        let dayNum = d.getDay();
        let diff = --week * 7;
        // If 1 Jan is Friday to Sunday, go to next week
        if (!dayNum || dayNum > 4) {
            diff += 7;
        }
        // Add required number of days
        d.setDate(d.getDate() - d.getDay() + ++diff);
        return d;
    }
